[General]

; DA settings
EnableDonate=0
EnableRTC=0
EnableInfiniteAmmo=0
EnableNoReload=0
SpawnProtection=2
EnableInvincibleBuildings=1


; FFA settings

; PlayerModel
;
;  Name of the soldier model to replace of all players.

PlayerModel=c_ag_gdi_mp

; PlayerTeam
;
;  ID of team to force all players. -1 (Renegade) by default makes all players be able to damage everything.

PlayerTeam=-1

; GameOverTeam
;
;  Team to put everyone on game over, so players can see their stats in end screen.

GameOverTeam=1

; UseMapSpawners
;
;  Uses the player spawners in the map for spawning.

UseMapSpawners=true

; PointsFix
;
;  Multiplies damage and death points by -1 of players.

PointsFix=true

; ******************************************************************************************

